import React from 'react'
import Button from '../Button/Buttton'
import classes from './ToolBar.css'

const toolbar = (props) => {
    return(
        <div className = {classes.Toolbar}>
            <Button>Pencil</Button>
            <Button>Line</Button>
            <Button>Shape</Button>
            <Button>Erase</Button>
        </div>
    );

}
export default toolbar;
